            66 => 
            array (
                'id' => 17,
                'name' => 'about_body_en',
                'val' => '<p>We are a Professional Conference Organizer with the tagline "Beyond Expectations, Beyond Events" that provides full services for offline events and specializes in virtual and hybrid events.</p><p>Established in 2016, with over 9 years of experience in the event industries, our certified team is equipped to organize corporate events, conferences, and other events on a national or regional scale. We offer only qualified equipment for hybrid events. Our services include event planning, marketing, creative concept development, design production, live streaming equipment, entertainment and talent management, on-site management, and a wide range of other services.</p><p>We value Creativity, Reliability, Innovation, Agility, Sustainability, and Integrity. Satisfied clients from various industries, including NGOs, the private sector, and government institutions, have entrusted us to organize their personal, corporate, and outdoor events.</p>',
