            79 => 
            array (
                'id' => 15,
                'name' => 'about_body',
            'val' => '<p>Kami adalah Penyelenggara Konferensi Profesional dengan tagline "<strong>Beyond Expectations, Beyond Events</strong>" yang menyediakan layanan penuh untuk acara offline dan berspesialisasi dalam acara virtual, hybrid.</p><p>Didirikan pada tahun 2016, dengan pengalaman lebih dari 9 tahun dalam industri acara, tim bersertifikat kami dilengkapi untuk menyelenggarakan acara korporat, konferensi, dan acara lainnya dalam skala nasional atau regional. Kami hanya menawarkan peralatan yang memenuhi syarat untuk acara hybrid. Layanan kami meliputi perencanaan acara, pemasaran, pengembangan konsep kreatif, produksi desain, peralatan live streaming, hiburan dan manajemen talenta, manajemen di lokasi (on-site), dan berbagai layanan lainnya.</p><p>Kami menjunjung tinggi Kreativitas, Keandalan, Inovasi, Ketangkasan (Agility), Keberlanjutan (Sustainability), dan Integritas. Klien yang puas dari berbagai industri, termasuk LSM, sektor swasta, dan institusi pemerintah, telah mempercayakan kami untuk menyelenggarakan acara pribadi, korporat, dan luar ruangan mereka.</p>',
